import React, { Component , useState ,useRef,useEffect } from "react";
import image from "../assets/loqow.png";
import "./Footer.scss";
import $ from 'jquery';
import { Link, withRouter } from "react-router-dom";
import { useHistory } from "react-router";
import { connect } from "react-redux";
import {  useTranslation , Trans, Translation } from "react-i18next";
import i18n from '../i18n';
import { Markup } from "interweave"

const Footer = ({deletecard}) => {

  const history = useHistory();
  const [search, setSearch] = useState("");
    const { t, i18n } = useTranslation();

  const handleKeyDown = (e) => {
  if (e.key === 'Enter') {
  if(search == "" || search == null || search == undefined ){
   alert("netice tapilmadi")
   console.log("searchfooter " + search)
  }
  else{
     history.push("/aftersearch");
     deletecard(search);
  }
    }
  }


  const handleChange = (e) => {
     e.preventDefault()
    setSearch(e.target.value.trim());
  };

  const handleClick = (e) => {
  if(search == "" || search == null || search == undefined ){
   alert("netice tapilmadi")
   console.log("searchfooter " + search)
  }
  else{
     history.push("/aftersearch");
     deletecard(search);
  }
  };


  return (
    <div className="footer">
      <div className="main">
        <div className="child-one">
          <div className="child-one-in">
            <img src={image} />
            <div>{t('Footertext1')}</div>
            <div>{t('Footertext2')}</div>
            <div><Markup content={t('Footertext3')} /> </div>
            <div className="rights">{t('Footertext4')}</div>
          </div>
        </div>

        <div className="child-two">
          <div className="child-two-in">
            <p>
              <Link to="/" >{t('Footerli1')}</Link> 
 
            </p>
            <p>
              <Link to="/faq" >{t('Navbarli4')}</Link> 
          
            </p>
            <p>
               <Link to="/cemiyyet" >{t('Navbarli2')}</Link> 
      
            </p>
            <p>
               <Link to="/fond" >{t('Navbarli1')}</Link> 
             
            </p>
            <p>
               <Link  to="/meeting" >{t('Navbarli3')}</Link> 
       
            </p>
            <p>
               <Link to="/blog" >{t('Navbarli5')}</Link> 
         
            </p>
          </div>
        </div>

        <div className="child-three">
          <div className="child-three-in">
            <div className="facebook-up">
              <a
                className="sosial-media-hover"
                target="_blank"
                href="https://www.facebook.com/hacklabaz"
              >
                Facebook
              </a>
              <a href="#up" className="up">
                   {t('Footertext5')}
              </a>
            </div>
            <a
              target="_blank"
              href="https://www.instagram.com/hacklabaz/"
              className="sosial-media-hover  sosial-media-hover"

            >
              Instagram
            </a>
            <a
              target="_blank"
              href="https://www.linkedin.com/company/hacklabaz"
              className="sosial-media-hover  sosial-media-hover"
            >
              Linkedin
            </a>

            <div className="search-icon">
              <input
                type="text"
                id="search_text"
                placeholder= {t('footerplaceholder')}
                autocomplete="off"
                onChange={handleChange} onKeyDown={handleKeyDown}
              />
              <div class="fa-search1" onClick={handleClick} >
                <img src="https://i.ibb.co/Yjc7Q3K/Whats-App-Image-2021-10-29-at-14-25-33-removebg-preview.png" />
              </div>
            </div>

            <div className="site-by">site by: ZOOM Agency</div>
            <div className="rights-phone">{t('Footertext4')}</div>
          </div>
        </div>
      </div>
    </div>
  );
};

const mapDispatchToProps = (dispatch) => {
  return {
    deletecard: (search) => {
      dispatch({ type: "AFTER_SEARCH", id: search });
    }
  };
};





export default connect(null, mapDispatchToProps)(Footer)
